import React from 'react';
import './ServicesPage.css';

const ServicesPage = () => {
  return (
    <div className="services">
      <header className="services-hero">
        <h1>Our Services</h1>
        <p>Explore the wide range of services we offer</p>
      </header>
    </div>
  );
};

export default ServicesPage;
